def predict(param):
    # param = param.split(',')[1]
    start_time = time.time()
    imgdata = base64.b64decode(param)
    img = Image.open(BytesIO(imgdata))
    img = img.convert('RGB')
    http_url = 'https://api-cn.faceplusplus.com/facepp/v3/detect'
    key = "LwIjT9iisB-L2pWV826RRFxtjW5LEGAF"
    secret = "TfMl3-Lcie_mdKeDzOkUx5qPgYXQAmrn"
    boundary = '----------%s' % hex(int(time.time() * 1000))
    data = []
    data.append('--%s' % boundary)
    data.append('Content-Disposition: form-data; name="%s"\r\n' % 'api_key')
    data.append(key)
    data.append('--%s' % boundary)
    data.append('Content-Disposition: form-data; name="%s"\r\n' % 'api_secret')
    data.append(secret)
    data.append('--%s' % boundary)
    data.append('Content-Disposition: form-data; name="%s"; filename=" "' % 'image_file')
    data.append('Content-Type: %s\r\n' % 'application/octet-stream')
    data.append(imgdata)
    data.append('--%s' % boundary)
    data.append('Content-Disposition: form-data; name="%s"\r\n' % 'return_landmark')
    data.append('1')
    data.append('--%s' % boundary)
    data.append('Content-Disposition: form-data; name="%s"\r\n' % 'return_attributes')
    data.append(
        "gender,age,smiling,headpose,facequality,blur,eyestatus,emotion,ethnicity,beauty,mouthstatus,eyegaze,skinstatus")
    data.append('--%s--\r\n' % boundary)

    for i, d in enumerate(data):
        if isinstance(d, str):
            data[i] = d.encode('utf-8')

    http_body = b'\r\n'.join(data)

    # build http request
    req = urllib.request.Request(url=http_url, data=http_body)

    # header
    req.add_header('Content-Type', 'multipart/form-data; boundary=%s' % boundary)

    try:
        # post data to server
        resp = urllib.request.urlopen(req, timeout=10000)
        # get response
        qrcont = resp.read()
        # if you want to load as json, you should decode first,
        # for example: json.loads(qrount.decode('utf-8'))
        m = qrcont.decode('utf-8')
        n = json.loads(m)
        if n["faces"] == []:
            return 2,time.time()-start_time
        else:
            host = '192.168.23.90'
            port = '8500'
            image_size = (224, 224, 3)

            channel = grpc.insecure_channel(host + ":" + port)
            stub = prediction_service_pb2_grpc.PredictionServiceStub(channel)
            request = predict_pb2.PredictRequest()
            request.model_spec.name = 'nudeDetect'
            request.model_spec.signature_name = 'keras_classification'
            request.model_spec.version.value = 1

            def deal_image(img,image_size):
                # img = Image.open(image_path)
                img = img.resize((image_size[0], image_size[1]), Image.ANTIALIAS)
                img = np.array(img)
                img = np.multiply(img, 1.0 / 255.0)
                img = np.reshape(img, [1, img.shape[0], img.shape[1], image_size[2]])
                img = img.astype(np.float32)
                return img

            img = deal_image(img, image_size)
            dims = [tensor_shape_pb2.TensorShapeProto.Dim(size=dim) for dim in list(img.shape)]
            tensor = tensor_pb2.TensorProto(
                dtype=types_pb2.DT_FLOAT,
                tensor_shape=tensor_shape_pb2.TensorShapeProto(dim=dims),
                float_val=list(img.reshape(-1)))
            request.inputs['image'].CopyFrom(tensor)
            result = stub.Predict(request, 10.0)
            result = tf.make_ndarray(result.outputs['classification'])
            result = result[0].tolist()
            result = result.index(max(result))
            end_time = time.time()
            waste_time =end_time - start_time
            return result,waste_time
    except urllib.error.HTTPError as e:
        return 3,time.time()-start_time

